import React from 'react'
import { connect } from 'react-redux'
import { logout } from '../actions/currentUser.js'

const Logout = ({logout}) => {
    const button = document.getElementsByClassName('logoutButton')
    return(
        button.logout()
    )
}
export default connect(null, {logout})(Logout)
